import React from 'react';
import Portfolio from './Portfolio';
import Header from './Header';

function PortfolioContainer (props){
    console.log(props);
    return (
        <div>
            <Header/>
            <Portfolio getAccount = {props.account} />
        </div>
    );
}

export default PortfolioContainer;
